text:
After 4 days stay with Karsten, you'll find he's a sweet amicable warm-hearted thoughtful dependable pleaure-server.

Besides, I had  extraordinary enjoyable and unforgettable moments with him. Furthermore, surprises are what you'll find: 
i) individual guest room with good heat condition and clean quilt cover, bed sheet, let alone the facial towel and the shower towel; 
ii) delicious and sweet brunch could light up your new day; 
iii) patient tour guide offering recommendation and helping you with Hamburg travel schedule; 
iv) good-tempered and don't show any impatience, though, I ask too much questions at times

OBS!    Just bring him a postcard from your local country as a gift on first meeting will delight him :)

