{'id': '12823960', 'text': 'Although I really was busy the two days we hosted Louis I really enjoyed the time that we had talking about ideas, experiences, movies, traveling, belgian beer (thanks for the amazing Grimbergen) and (as we say in Germany) "god and the world". It felt like we know each other much longer. Louis is such an easy-going and interested guy who was exploring the city on his own during the day. I really appreciated his perspective on my own city when he told us about his day, his fresh and curious way to approach a place I already know for such a long time made me experience my "home" in a fresh way and I instantly wanted to join him and discover places I passed to easily before because I got used to it (I really wanna visit the BallinStadt museum now).

He spent only to days in Hamburg but we hope that he is coming back soon. 

